using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using File = ContentCaptureApi.File;

namespace Integra.Persistence.ContentCapture
{
    public class EmptyPageBase64 
    {
        public EmptyPageBase64()
        {
            SeparatorDocument = new File()
            {
                Name = "Separator.pdf",
                Bytes = Convert.FromBase64String(base64SeparatorPDF)
            };
        }

        public readonly File SeparatorDocument;

        private string base64SeparatorPDF =
            "";
    }
}
